int readcount;
sem_t rsAccess, rcAccess, sQueue;

void *reader(void *arg)
{
    int id, i;

    id = *(int *)arg;

    sem_wait(&sQueue);
    sem_wait(&rcAccess);
    if(readcount == 0)
	sem_wait(&rsAccess);
    readcount++;

    sem_post(&sQueue);
    sem_post(&rcAccess);

    /*
     * Begin Critical Section
     */
    printf("<");
    for (i = 0; i < N; ++i)
        printf("%c", 'A'+id);
    printf(">");
    /* 
     * End Critical Section
     */

    sem_wait(&rcAccess);
    readcount--;
    if(readcount == 0)
	sem_post(&rsAccess);
    sem_post(&rcAccess);

    pthread_exit(0);
}

void *writer(void *arg)
{
    int id, i;
    struct timespec req, rem;

    id = *(int *)arg;
    req.tv_sec = 0;
    req.tv_nsec = 100000000L;
    
    sem_wait(&sQueue);
    sem_wait(&rsAccess);
    sem_post(&sQueue); 

    /*
     * Begin Critical Section
     */
    printf("\n");
    if (id == 0)
        for (i = 0; i < L; ++i)
            printf("%s\n", t[i]);
    else
       for (i = 0; i < M; ++i)
            printf("%s\n", d[i]);
    /* 
     * End Critical Section
     */
    nanosleep(&req, &rem);
    sem_post(&rsAccess);

    pthread_exit(0);
}

int main(void)
{
    int i;
    int rarg[RNUM], warg[WNUM];
    pthread_t rthid[RNUM];
    pthread_t wthid[WNUM];
    pthread_attr_t attr;
    struct timespec req, rem;

    sem_init(&rsAccess,0,1);
    sem_init(&rcAccess,0,1);
    sem_init(&sQueue,0,1);

    /*
     * Initialize thread attributes
     */
    if (pthread_attr_init(&attr) != 0) {
            fprintf(stderr, "pthread_init error\n");
            exit(-1);
    }
    /* 
     * Create RNUM reader threads
     */
    for (i = 0; i < RNUM; ++i) {
        rarg[i] = i;
        if (pthread_create(rthid+i, &attr, reader, rarg+i) != 0) {
            fprintf(stderr, "pthread_create error\n");
            exit(-2);
        }
    }
    /* 
     * Create WNUM writer threads
     */
    for (i = 0; i < WNUM; ++i) {
        warg[i] = i;
        if (pthread_create(wthid+i, &attr, writer, warg+i) != 0) {
            fprintf(stderr, "pthread_create error\n");
            exit(-2);
        }
    }
    /* 
     * Wait for 0.5 second and terminate
     */
    req.tv_sec = 0;
    req.tv_nsec = 500000000L;
    nanosleep(&req, &rem);
    exit(0);
}
